Here's an example of how to rotate with trig
```
//change these and it still works
var playerX = 200, playerY = 200;

draw = function() {
    background(220);


    pushMatrix();//this prevents the rotate function from rotating anything but the rect

        rectMode(CENTER);//measures x/y position of rect by center instead of corner

        translate(playerX,playerY);//the rotate function rotates everything inside of the matrix around the origin (0,0) the top left of the screen.  What we are doing here is we are rotating it as if the center of the rect is at the origin, that way it rotates around it's center.  Then we shift it over to wherever the player position is

        var a = atan2(mouseY - playerY , mouseX - playerX);//this returns a value between 0-360, it uses trig to find the correct angle, don't worry about how it works, if you want to know though there is a course on KA that explains it.

        rotate(a);//rotates around origin 0-360 degrees

        //draw the rectangle
        fill(255, 0, 0);
        rect(0,0,40,20);

    popMatrix();
};


```

