An array holds a certain amount of values, such as functions. To create a clicker with them, you would start out by creating an array with a few functions in it:```
var scenes = [
    function(){
        // scene 1 goes here
    },
    function(){
        // scene 2 goes here
    },
    function(){
        // scene 3 goes here
    },
    function(){
        // scene 4 goes here
    }
];
```Then define variable `scene`:```
var scene = 0;
```Now, you can use this stuff to make a clicker:```
var scene = 0;
var scenes = [...];

draw = function(){
    scenes[scene]();
};
mouseClicked = function(){
    scene = (scene + 1) % scene.length;
};
```Note: the `% scene.length` just means, "If the scene is greater than how many scenes there are, reset back to 0"

